import React from 'react';
import { Box, Typography } from '@mui/material'
import { Container } from '@mui/system'
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';

const CardMoreClass = () => {
 return (
  <Card sx={{ width: '350px', height:'400px', display:'flex', flexDirection:'column'}}>
    <CardMedia
      component="img"
      height="234px"
      image="./tomyum.svg"
     />
     <Container width='100%'>
     <CardContent sx={{alignItems: 'flex-start', justifyContent: 'flex-start'}}>
     <Typography 
     fontWeight={200}
     alignText="flex-start"
     sx={{
      alignItmens: 'flex-start',
      justifyContent: 'flex-start',
      textAlign: 'left'

     }}>
      Asian
      </Typography>
      <Typography variant="body2" color="text.secondary">
        Lizards are a widespread group of squamate reptiles, with over 6,000
        species, ranging across all continents except Antarctica
      </Typography>
      </CardContent>

     </Container>

  </Card>

 )
}

const ListMoreClass = () => {
  return (
    <div>
      <Box>
        <Container maxWidth='xl' sx={{ marginTop: '70px'}}>
            <Typography variant='h3' color='primary' fontWeight={600}>
                More professional class
            </Typography>
            <Container
            sx={{
              gap: '24px',
              marginTop: '80px',
            }} >
              <CardMoreClass/>
              <CardMoreClass/>
              <CardMoreClass/>
              <CardMoreClass/>
            </Container>

        </Container>
      </Box>
    </div>
  )
}

export default ListMoreClass
